x27Tapu\x27 or else be prepared to leave the premises. Lost hopes of being heard by his son push Jethalal\x27 to call his father \x27Champaklal\x27 from the village. This was his great idea of leashing some control over the mischievous Tapu. The opposite happens and the grandfather joins hands with the grandson to make life a roller coaster troublesome ride for Jethalal.\\n\\nCast:\\n---------\\nDilip Joshi as Jethalal Champaklal Gada\\nDisha Vakani as Daya Jethalal Gada\\nNitish Bhaluni \/ Raj Anadkat \/ Bhavya Gandhi as Tipendra Jethalal Gada (Tapu)\\nAmit Bhatt as Champaklal Jayantilal Gada\\nSachin Shroff \/ Shailesh Lodha as Taarak Mehta\\nSunayana Fozdar \/ Neha Mehta as Anjali Taarak Mehta\\nTanuj Mahashabde as Krishnan Subramaniam Iyer\\nMunmun Dutta as Babita Krishnan Iyer\\nMandar Chandwadkar as Aatmaram Tukaram Bhide\\nSonalika Joshi as Madhvi Aatmaram Bhide\\nJheel Mehta \/ Nidhi Bhanushali \/ Palak Sidhwani \/ Khushi Mali as Sonalika Aatmaram Bhide (Sonu)\\nGurucharan Singh \/ Balwinder Singh Suri as Roshan Singh Harjeet Singh Sodhi\\nJennifer Mistry Bansiwal \/ Monaz Mevawala as Roshan Kaur Roshan Singh Sodhi\\nSamay Shah as Gurucharan Singh Roshan Singh Sodhi (Gogi)\\nKavi Kumar Azad \/ Nirmal Soni as Dr. Hansraj Hathi\\nAmbika Ranjankar as Komal Hansraj Hathi\\nKush Shah \/ Dharmit Turakhia as Gulabkumar Hansraj Hathi (Goli)\\nShyam Pathak as Popatlal Pandey\\nKuldeep Gor as Ratan Binjola\\nDharti Bhatt as Rupa Baditop Binjola\\nAkshaan Sehrawat as Veer\\nMaahi Bhadra as Bansari\\nSharad Sankla as Abdul\\nAzhar Shaikh as Pinku\\nGhanshyam Nayak \/ Kiran Bhatt as Nattu Kaka\\nTanmay Vekaria as Bagha\\nNavina Wadekar \/ Monika Bhadoriya as Bawri\\nDaya Shankar Pandey as Chalu Pandey\\nRakesh Bedi as Taarak\x27s Boss\\nMayur Vakani as Sundarlal\\nKanti Joshi as Baka\\n\\nProduced By: Neela Asit Modi, Asit Kumarr Modi \\nSpecial Thanks: Mahesh Vakil, Indu Tarak Mehta\\nSet Design: Jayant Deshmukh\\nOn-Air Promotion  ( SAB): SAB OAP\\nCostume Designer: Al lse be prepared to leave the premises. Lost hopes of being heard by his son push Jethalal\x27 to call his father \x27Champaklal\x27 from the village. This was his great idea of leashing some control over the mischievous Tapu. The opposite happens and the grandfather joins hands with the grandson to make life a roller coaster troublesome ride for Jethalal.\\n\\nCast:\\n---------\\nDilip Joshi as Jethalal Champaklal Gada\\nDisha Vakani as Daya Jethalal Gada\\nNitish Bhaluni \/ Raj Anadkat \/ Bhavya Gandhi as Tipendra Jethalal Gada (Tapu)\\nAmit Bhatt as Champaklal Jayantilal Gada\\nSachin Shroff \/ Shailesh Lodha as Taarak Mehta\\nSunayana Fozdar \/ Neha Mehta as Anjali Taarak Mehta\\nTanuj Mahashabde as Krishnan Subramaniam Iyer\\nMunmun Dutta as Babita Krishnan Iyer\\nMandar Chandwadkar as Aatmaram Tukaram Bhide\\nSonalika Joshi as Madhvi Aatmaram Bhide\\nJheel Mehta \/ Nidhi Bhanushali \/ Palak Sidhwani \/ Khushi Mali as Sonalika Aatmaram Bhide (Sonu)\\nGurucharan Singh \/ Balwinder Singh Suri as Roshan Singh Harjeet Singh Sodhi\\nJennifer Mistry Bansiwal \/ Monaz Mevawala as Roshan Kaur Roshan Singh Sodhi\\nSamay Shah as Gurucharan Singh Roshan Singh Sodhi (Gogi)\\nKavi Kumar Azad \/ Nirmal Soni as Dr. Hansraj Hathi\\nAmbika Ranjankar as Komal Hansraj Hathi\\nKush Shah \/ Dharmit Turakhia as Gulabkumar Hansraj Hathi (Goli)\\nShyam Pathak as Popatlal Pandey\\nKuldeep Gor as Ratan Binjola\\nDharti Bhatt as Rupa Baditop Binjola\\nAkshaan Sehrawat as Veer\\nMaahi Bhadra as Bansari\\nSharad Sankla as Abdul\\nAzhar Shaikh as Pinku\\nGhanshyam Nayak \/ Kiran Bhatt as Nattu Kaka\\nTanmay Vekaria as Bagha\\nNavina Wadekar \/ Monika Bhadoriya as Bawri\\nDaya Shankar Pandey as Chalu Pandey\\nRakesh Bedi as Taarak\x27s Boss\\nMayur Vakani as Sundarlal\\nKanti Joshi as Baka\\n\\nProduced By: Neela Asit Modi, Asit Kumarr Modi \\nSpecial Thanks: Mahesh Vakil, Indu Tarak Mehta\\nSet Design: Jayant Deshmukh\\nOn-Air Promotion  ( SAB): SAB OAP\\nCostume Designer: Alka Mehta\\nCostu
